  title: 'Vouchers Parceiros'
};
const PropertyGridPage = () => {
  return <>
      <PageTitle title="Vouchers Parceiros" subName="Real Estate" />
      <Row>
        <PropertiesFilter />
        <PropertiesData />
      </Row>
    </>;
};
export default PropertyGridPage;
